const ReviewSection = () => {
    return (
        <ReviewContainer>
            <SearchWrapper>
            <SearchBox>
                <SearchTerm>
                <SearchInput type="text" />
                </SearchTerm>

                <SearchButton>
                    {BsSearch}
                </SearchButton>


            </SearchBox>
            </SearchWrapper>
        </ReviewContainer>
    )
}

export default ReviewSection;


